import React from 'react';

const HoverSubMenu = ({ submenuItems }) => {
  return (
    <ul className="submenu-container">
      {submenuItems.map((item, index) => (
        <li key={index}>
          {/* Render each submenu item */}
          {/* ... */}
        </li>
      ))}
    </ul>
  );
};

export default HoverSubMenu;
